import styled from 'styled-components'

const Footer = () => {
  return (
    <FooterContainer>
      https://github.com/energywraith
      <a href='https://github.com/energywraith' rel='noreferrer'>
        
      </a>
    </FooterContainer>
  )
}

const FooterContainer = styled.footer`
  padding: 1em;

  display: flex;
  justify-content: center;
`

export default Footer
